css:
.git-control .menu {
  border-bottom: 1px solid #d1d1d2;
  background: inherit;
}
.git-control .menu .item {
  display: inline-block;
  margin: 5px 0 5px 5px;
  padding: 5px;
  cursor: pointer;
  border-radius: 4px;
}
.git-control .menu .item:hover {
  color: #282929;
}
.git-control .menu .item.inactive,
.git-control .menu .item.inactive:hover {
  color: #939395;
  cursor: default;
}
.git-control .menu .item div {
  text-align: center;
  width: 100%;
  min-width: 60px;
}
